import { Data } from "./Data"
import React from 'react';
import { Subgrid, SuperSubgrid } from "./Counteranimation.element";
function Component({Data}) {
    return (
        <>
        <Subgrid>
            <SuperSubgrid>
                <div></div>
                <div></div>
            </SuperSubgrid>
        </Subgrid>

     </>
    )
}

export default Component
